import background_image from "../images/background.png";
import logoImage from "../images/logo.svg";
import gifImage from "../../src/gif.gif";
import TransitionBtn from "../components/TransitionBtn.js"
import "../style/Section.css"
import "../style/Home.css"

function Home() {

    return (
        <div className="section">
          <div className="Home">
            <div className="leftLogo">
              <img src={logoImage}> 
              </img>
            </div>
            <div className="rightGif" data-aos="fade-left"> 
              <img src={gifImage} alt="gif loading"/>
            </div>
          </div>
          <TransitionBtn navUrl="About"/>
        </div>
      );
}
export default Home;
